import {
    STORY_ADD,
    STORY_FETCH,
    STORIES_FETCH_ERROR,
    SIGN_IN
} from "../constants/actionTypes";

const doAddStories = stories => ({
    type: STORY_ADD,
    stories
});

const doFetchStories = query => ({
    type: STORY_FETCH,
    query
});

const doFetchErrorStories = query => ({
    type: STORIES_FETCH_ERROR,
    query
});

const doLogin = userData => ({
    type: STORY_FETCH,
    userData
});
export {
    doAddStories,
    doFetchStories,
    doFetchErrorStories,
    doLogin
}
